INSERT INTO `ipass_lblist` VALUES ('1', 'cpq14pf', '卡特尔14pf人格量表(14PF)', '世界上没有完全一样的性格，测测自己有几面吧`(适用于儿童青少年)', 'Upload/2017-01-04/1.jpg', '适用于8-14岁的中小学生，主要从乐群性、聪慧性、（情绪）稳定性、恃强性、兴奋性、有恒性、敢为性、敏感性、怀疑性、幻想性、世故性、忧虑性、自律性和紧张性这14种人格因素进行测评分析。', '亲爱的同学：你好。这里有不少大家都感兴趣的问题，请你来回答。由于每个人对这些问题都会有自己的看法，回答起来一定是不会相同的，因而对这些问题的回答，并没有对与不对之分，只是表明每个人对这些问题的态度，请你不要有所顾虑，要尽量坦率地表达自己对这些问题的真实兴趣和态度。对测题不要费时间去考虑怎样答才对，因为无所谓对错，而要顺其自然，你是怎样想的和做的就怎样回答。注意：每一测题都要回答，不要有遗漏。每一测题只能选择一个答案，不许多选。必须在50分钟内回答完全部测题，请掌握好时间。', '3', '3', '0', '1', '140', '0', '0', '', null);
INSERT INTO `ipass_lblist` VALUES ('2', 'scl90', '症状自评量表(SCL-90)', '从感觉、情感、思维、意直到生活习惯、人际关系、多种角度评估测一测吧（适用于16岁以上）', 'Upload/2017-01-04/97.jpeg', '症状自评量表由L.R.Derogatis于1975年编制,含有90个项目，每项5级评分．测量较广泛的精神症状学内容，从感觉、情感、思维、意识、行为指导生活习惯、人际关系、饮食睡眠等，要求被试者根据自己的实际情况来做评定。测得的是一个人某段时间里（通常是一周）的症状水平。本量表使用简便，测查角度全面。它对有可能处于心理障碍边缘的人有良好的区分功能，适用与测查人群中哪些人可能有心理障碍、有何种心理障碍及其严重程度如何。在临床上常常作为诊断的参考，也可以用作初级的筛查工具。', '亲爱的同学，你好。以下表格中列出了有些人可能有的病痛或问题，请你仔细阅读每一道试题，然后根据最近一星期内的状况，回答下列问题，请在最合适的圆格内单击鼠标左键。为了保证检测结果的准确性，请不过要漏掉其中的任何一题。\r\n\r\n1.从无：自觉无该项症状问题。\r\n2.轻度：自觉有该项问题，但发生得并不频繁、严重。\r\n3.中度：自觉有该项症状，其严重程度为轻到中度。\r\n4.偏重：自觉常有该项症状，其程度为中到严重。\r\n5.严重：自觉常有该项症状，频度和程度都十分严重\r\n', '9', '9', '0', '2', '90', '0', '0', '', '从无|轻度|中度|偏重|严重');
INSERT INTO `ipass_lblist` VALUES ('5', 'mht', '心理健康诊断测验(MHT)', '快看看你的压力有没有超负荷吧？给心灵体检一下！', 'Upload/2017-01-04/9.jpg', '学生心理健康综合测量包含学习焦虑、对人焦虑、孤独倾　向、自责倾向、过敏倾向、身体症状、恐怖倾向、冲动倾向八个方面，100个测验题目。可以帮助学生更深入地了解自己，帮助自己保持良好心态。\r\n', 'A、这些测题是调查你的心情和感受的，不是测验智力和学习能力，与学习成绩无关，答案也没有好坏之分，请按照你平时所想的如实回答。\r\nB、难以决定时，请选择与你最接近的答案。', '5', '5', '0', '5', '101', '0', '0', null, null);
INSERT INTO `ipass_lblist` VALUES ('7', 'sds', '自评抑郁量表(SDS)', '我要做一个阳光开朗的宝宝~发现并清除负能量', 'Upload/2017-01-04/94.jpeg', '自评抑郁量表是W.K.Zung于1965年编制，用于衡量抑郁状态的轻重程度及其在治疗中的变化。该量表的评定时间跨度为最近一周，评分不受年龄、性别、经济状况等因素影响，但如受试者文化程度较低或智力水平较差不能进行自评。', '该量表由20个陈述句和相应问题条目组成；每一条目相当于一个有关症状，均按1、2、3、4四级评分，请根据自己的实际感受选择相关回答。', '6', '6', '0', '7', '20', '0', '0', null, '偶尔或从无|有时|经常|持续');
INSERT INTO `ipass_lblist` VALUES ('9', 'embu', '父母养育方式问卷(EMBU)', '爸爸妈妈是人生的第一任老师，父母的养育方式也会影响孩子的一生。', 'Upload/2017-01-04/6.jpeg', '父母教养方式问卷于1980年由瑞典Umea大学精神医学系C.Perris等人编制，用于评定父母的教养方式。中文版EMBU由中国医科大学心理学教研室的岳冬梅、李鸣果、金魁和、丁宝坤修订。修订后的量表经过主因素分析，确定了66个条目。\r\n　　量表要求被试回忆早期经历的父母教养方式，并作出4级评分。施测时间约30分钟。\r\n　　该量表不适用于年龄幼小的被试和年龄过大的被试，而适用于中青年被试（15～54 岁左右），该年龄段的被试对父母的评价更客观、稳定，回忆的准确性也较高。\r\n', '在每个人成长的过程中，父母的言传身教都给我们留下了深刻的印象。请您努力回想一下在您小时候父母对待您的方式，回答问题。\r\n每个题目均有4个等级，分别是“从不、偶尔、经常、总是”。请您分别选择最适合您父亲和您母亲的等级，先对父亲做评定，再对母亲做评定。您父亲和母亲对您的教养方式可能是相同的，也可能是不同的。请您实事求是的分别回答。\r\n4个等级之后还有一个选项是“题目不适”。如果您幼时父母不全，或者您是独生子女，应对相关的题目作出“题目不适”的回答。', '10', '10', '0', '9', '66', '0', '0', null, null);
INSERT INTO `ipass_lblist` VALUES ('12', 'fes', '家庭环境量表(FES)', '良好的家庭环境促进家庭教育，快来测一测家庭环境对孩子成长的影响', 'Upload/2017-01-04/95.png', '该量表含有10个分量表，分别评价10个不同的家庭环境特征：（1）亲密度（Cohesion），即家庭成员之间互相承诺、帮助和支持的程度；（2）情感表达（Expressiveness），即鼓励家庭成员公开活动，直接表达情感的程度；（3）矛盾性（Conflict），也就是家庭成员之间公开表露愤怒、攻击和矛盾的程度；（4）独立性（Independence），即家庭成员的自尊、自信和自主程度；（5）成功性（Achievement Orientation），是将一般性活动，如上学和工作变为成就性或竞争性活动的程度；（6）知识性（Intellectual-Cultural Orientation），即对政治、社会、智力和文化活动的兴趣大小；（7）娱乐性（Active-Recreational Orientation），即参与社交和娱乐活动的程度；（8）道德宗教观（Moral-Religious Emphasis），即对伦理、宗教和价值观的重视程度；（9）组织性（Organization），即安排家庭活动和责任时有明确的组织和结构的程度；（10）控制性（Control），即使用固定家规和程序来安排家庭生活的程度。\r\n该问卷的中文版（简称FES-CV）由费立鹏等人于1991年修订。中文版对一些不适合中国文化的条目做了修改，并改写了两个最不符合中国文化的分量表：独立性和道德宗教观。\r\n修订结果显示，该量表效度较好。精神分裂症病人及其家属的评定没有显著差异，说明病人及家属对家庭环境的感受基本一致。正常人家庭和精神分裂症病人家庭4个分量表上有显著差异，正常人家庭在亲密度、知识性和娱乐性分量表中得分显著高于精神分裂症病人家庭，在矛盾性分量表上得分显著低于精神分裂症家庭，说明量表具有较好的判别效度。家庭亲密度和适应性量表中文版（FACESII-CV）评定的亲密度与本量表评定的亲密度呈正相关，与本量表评定的矛盾性呈负相关，说明有较好的趋集效度。\r\n量表的重测信度在不同的分量表中有所不同。亲密度、矛盾性、知识性和组织性4个分量表的内部一致性信度较高，成功性、娱乐性和控制性3个分量表的一致性稍差，独立性、道德宗教观和情感表达3个分量表的内部一致性信度很差。可能是因为这些分量表的内容不太适合中国文化。在应用量表做解释时应该慎重。使用量表对学习成绩良好和成绩差的儿童测查发现，高分儿童的家庭气氛更融洽，家庭成员自由表达情感的程度更高，追求成功的动机较强，同时高分儿童家庭冲突较少，彼此攻击和敌视的现象较少。这样的家庭特征有利于培养儿童的学习积极性，提高学习效率。\r\n量表使用要求受试者具有初等以上教育程度，主试应监控受试者完成量表的全过程，在受试者不能理解多个项目时应中止测试并确认答卷无效。', '该问卷用于了解您对您家庭的看法。请您确定以下问题是否符合您家里的实际情况。如果您认为某一问题符合或基本上符合您家庭的实际情况，请选择“是”；如果不符合或基本上不符合，请选择“否”。如果难以判断是否符合，您应该按多数家庭成员的表现或者经常出现的情况做答。如果仍无法确定，就按您自己的估计回答。请务必回答每一个问题。有些问题带有“★”，表示此句有否定的含义，请注意正确理解句子内容。记住，该问卷所指的“家庭”是指与您共同食宿的小家庭。在回答问卷时不要推测别人对您的家庭的看法，请一定按实际情况来回答。', '10', '10', '0', '10', '90', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('14', 'conners', 'Conners儿童行为量表（父母问卷）', 'Conners儿童行为量表主要用来筛选儿童的问题行为，特别是多动症问题。本问卷由儿童的父母作答。', 'Upload/2017-01-04/2.jpeg', '同Achenbach（CBCL）儿童行为量表、Butter儿童行为量表一样， Conners儿童行为量表也是一种应用十分广泛、有较高信度和效度的儿童行为测量方法。目前使用较多的是父母问卷和教师问卷，与其它方法相比，该量表具有条目少、简便易行等特殊优点。这里介绍的是父母问卷，即由父母根据自己孩子的实际情况，实事求是地回答每个问题。该量表共有48个项目。', '请根据您的孩子最近1年的情况，选择最符合他（她）实际的那个选项，请如实回答每个提问。', '9', '9', '0', '14', '48', '0', '0', null, '没有|很轻|较重|严重');
INSERT INTO `ipass_lblist` VALUES ('20', 'phcss', '儿童自我意识量表', '不良的自我意识对儿童的行为、学习和社会能力造成不良影响，检测一下吧。', 'Upload/2017-01-04/5.jpeg', '儿童自我意识量表(Children\'s self-concept Scale，PHCSS) 是美国心理学家Piers 及Harris 于1969年编制、1974年修订的儿童自评量表，主要用于评价儿童自我意识的状况。儿童自我意识反映了儿童对自己在环境和社会中所处的地位的认识, 也反映了评价自身的价值观念,是个体实现社会化目标、完善人格特征的重要保证。如果在发育过程中受内外因素的影响,使儿童的自我意识出现不良倾向,则会对儿童的行为、学习和社会能力造成不良影响, 使儿童的人格发生偏异。\r\nPHCSS含80项是否选择型测题,适用于8-16岁儿童。', '下面有80个问题,是了解你是怎样看待你自己的。请你决定哪些问题符合你的实际情况,  哪些问题不符合你的实际情况。 如果你认为某一个问题符合或基本符合你的实际情况,就在答卷纸上相应的题号后的\"是\"字上划圈,如果不符合或基本不符合你的实际情况,就在答卷纸上相应的题号后的\"否\"字上划圈。 对于每一个问题你只能作一种回答,并且每个问题都应该回答。请注意,这里要回答的是你实际上认为你怎样,而不是回答你认为你应该怎样。', '12', '12', '0', '20', '80', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('22', 'zyqx', '职业倾向系列问卷', '科学家？航天员？医生？律师？多年以后，我最适合从事什么职业？', 'Upload/2017-01-04/98.jpeg', '一般来说，人们在择业时主要受三个因素的影响：兴趣（你想做什么）、能力（你能做什么）和人格（你适合做什么）。以此为依据，这套系列问卷由三部分组成：兴趣倾向问卷、个体经历问卷和人格倾向问卷，分别对你的兴趣、能力和人格特点进行测查，帮助你更加全面的了解自己，以便在升学和择业时能够有的放矢。', '职业倾向系列测验由兴趣倾向问卷、个体经历问卷和人格倾向测验三个测验组成，请仔细阅读每一道题目，并根据自己的实际情况回答“是”或“不是”，所有题目的答案无对错之分。答题时注意，请根据自己的第一反应回答。不要过分推敲，以保证结果的真实可靠。做完所有题目后通过对结果进行分析，你将会比较全面、准确的了解自己的职业兴趣，从而为将来的职业选择和报考专业提供参考。', '4', '4', '0', '22', '144', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('24', 'zydx', '兴趣与职业定向自我测试', '兴趣！爱好！我未来能做什么？要做什么？能做多好？', 'Upload/2017-01-04/92.jpeg', '下面这个量表有助于青年人的职业定向，根据这张表，每个中学生在学习期间，就可以查明并巩固自己的兴趣，避免毕业选择志愿和专业的手足无措。', '请你根据自己的实际情况，对下面的135道题作出回答。', '4', '4', '0', '24', '135', '0', '0', null, '非常喜欢|比较喜欢|不确定|比较不喜欢|非常不喜欢');
INSERT INTO `ipass_lblist` VALUES ('27', 'ssgx', '师生关系测验问卷', '是师生？是朋友？快来测一测我们和亲爱的老师之间的关系~', 'Upload/2017-01-04/8.jpg', '中学生对自己同老师之间的关系是极为敏感的。他们可能因与老师的关系处理得好而觉得学习、生活愉快，也可能因与老师关系处理得不好而感到前途无望。了解自己与老师关系的问题的所在，是改进师生关系的前提。这里介绍一个师生关系测验问卷，以帮助中学生了解自己的师生关系状况。', '本测验共有18个陈述句项目。请仔细阅读每个项目，并对照自己的实际情况，作为“是”与“否”的判断。然后从每个项目后的“是”与“否”备选答案中选择其中的一个，点击鼠标。', '8', '8', '0', '27', '18', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('30', 'tat', '考试焦虑自评量表(TAT)', '我喜欢考试吗？我怕考不好吗？测一测我考试前的焦虑程度吧', 'Upload/2017-01-04/96.jpeg', '考试焦虑直接影响到考试水平的发挥和成绩的提高，本量表帮助您判断自己的考试焦虑程度并为您提供一些意见和建议。', '考试焦虑直接影响到考试水平的发挥和成绩的提高，本量表帮助您判断自己的考试焦虑程度并为您提供一些意见和建议。请根据您的实际情况选择回答。', '5', '5', '0', '30', '33', '0', '0', null, '非常符合|比较符合|较不符合|很不符合');
INSERT INTO `ipass_lblist` VALUES ('70', 'tabp', 'A型行为类型问卷(TABP)', '快来测测你的“想赢”是进取心，还是胜负欲？成功还是卓越？', 'Upload/2017-01-04/3.jpeg', 'A型行为类型问卷(Type A Behavior  Pattern Scale),简称TABP,是由张伯源教授于1983年主持全国性的协作组开始修订,含有60个题目,用于鉴别行为类型是A型的人。研究参考了美国的一些A型行为测查量表的内容并根据中国人的自身特点，经过三次测试和修订，完成的信度效度教高的A类行为类型量表。', '请根据实际情况，选择“是”、“否。”', '3', '3', '0', '70', '60', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('72', 'xxxgysjn', '学习习惯与应试技能测查表', '我会学习吗？我会考试吗？快来测一测吧~让自己爱上学习！', 'Upload/2017-01-04/93.jpeg', '这套问卷用于小学高年级学生对其学习习惯和应试技能的自我检查，可帮助学生了解自己在学习习惯和应试技能方面存在的问题。', '请你仔细阅读问卷上的每一个题目，并与自己的实际的情况相对照。若觉得相符，则选择“是”，不相符合则选择“否”。', '5', '5', '0', '72', '44', '0', '0', null, '是|否');
INSERT INTO `ipass_lblist` VALUES ('77', 'xlsy', '心理适应性量表', '面对周围的环境，我们能不能尽快地适应新环境，能否处理好复杂、重大或危急的特殊情况？', 'Upload/2017-01-04/91.jpeg', '心理适应性主要指各种个性特征互相配合起来，适应周围环境的能力。一个人能否尽快地适应新环境，能否处理好复杂、重大或危急的特殊情况，与他(她)的心理适应性高低有很直接的关系。新生朋友，从中学考入大学，赴异地求学，学习、生活的环境、方式都发生了很大的变化，这就要求当事人做出适当的调整，以适应新环境、新生活的变化。这里介绍一种简易的心理适应性测试量表，你不妨做一做，了解一下自己的心理适应性现状。', '本量表共20道题目，每题有5种答案。请在阅读每题后，从答案中选择最符合你实际情况的那一项，用鼠标点击。', '11', '11', '0', '77', '20', '0', '0', null, '完全同意|有些同意|无所谓同意或不同意|有些不同意|完全不同意');
INSERT INTO `ipass_lblist` VALUES ('89', 'sas', '焦虑自评量表(SAS)', '适度水平的焦虑更有效果！想了解近一个星期你的焦虑水平如何？', 'Upload/2017-01-04/99.jpg', '焦虑自评量表(Self-Rating Anxiety Scale, SAS)是W.K.Zung于1971年编制，用于评出有焦虑症状的个体的主观感受，作为衡量焦虑状态的轻重程度及其在治疗中的变化的依据。SAS是一种分析病人主观症状的临床工具，用于评出有焦虑症状的个体的主观感受，作为衡量焦虑状态的轻重程度及其在治疗中的变化的依据。 而焦虑是心理咨询门诊常见的一种情绪障碍，近年来，SAS已作为咨询门诊中了解焦虑症状的一种自评工具。 SAS测量的是最近一周内的症状水平，评分不受年龄、性别、经济状况等因素的影响，但如果应试者文化程度较低或智力水平较差不能进行自评。', '请您仔细阅读每一个陈述，根据您最近的一周的实际感觉作出回答。从“没有或很少时间”到“绝大部分或全部时间”表示不同的程度。', '6', '6', '0', '89', '20', '0', '0', null, '没有或很少时间|少部分时间|相当多时间|绝大部分或全部时间');
INSERT INTO `ipass_lblist` VALUES ('96', 'epq4', '艾森克情绪稳定性测验', '心理学把这些情绪分为快乐、愤怒、悲哀、恐惧四种基本形式。我们要做情绪的主人！', 'Upload/2017-01-04/4.jpeg', '艾森克是英国伦敦大学的心理学教授，是当代最著名的心理学家之一，编制过多种心理测验。情绪稳定性测验可以被用于症断是否存在自卑、抑郁、焦虑、强迫症、依赖性、疑心病观念和负罪感。', '下面给出210道题，请你逐一作答。你可以在“是”、“否”和“不好说”三个答案中选择一个，用鼠标左键单击你的选择。请你尽量选择“是”和“否”。不要过多地思考每个题目的细微意义，最好根据自己的第一感受来回答。', '9', '9', '0', '96', '210', '0', '0', null, '是|否|不好说');
INSERT INTO `ipass_lblist` VALUES ('118', null, '一般自我效能感量表', '测测你的自信有多坚实？面对挑战有多大的信心？能坚持多久？', 'Upload/2017-01-04/991.jpg', '自我效能感是指个体对自己面对环境中的挑战能否采取适应性的行为的知觉或信念。一个相信自己能处理好各种事情的人，在生活中会更积极、更主动。这种“能做什么”的认知反映了一种个体对环境的控制感。因此自我效能感是以自信的理论看待个体处理生活中各种压力的能力。', '请仔细阅读下面的一些描述，每个描述后有四个选项，请根据真实情况，选择最符合您情况的一项。', '2', '2', '0', '23', '10', '0', '0', null, null);
INSERT INTO `ipass_lblist` VALUES ('124', null, '个人评价问卷(PEI)', '面对学业，外表，爱情关系，朋友这些问题，我能很好的面对吗？', 'Upload/2017-01-04/7.jpeg', '个人评价问卷（Personal   Evaluation  Inventory，PEI）是用来评定自我评价的一个方面 ——自信。一般认为自信是一个人对自己能力或技能的感受，使对自己有效地应付各种环境的能力主观评价。', '以下列出了许多反映了普遍的情感、态度和行为的陈述、请仔细阅读每一个陈述，考虑一下它是否使用于你。尽量诚实、准确的做答，但没有必要每一条都刻意花太多时间。除非特别标明时间界限、否则请考虑一下近两个月内这些条目对你是否适用：“非常同意”，“基本同意”，“基本不同意”，“极不同意”。', '2', '2', '0', '24', '54', '0', '0', null, null);
INSERT INTO `ipass_lblist` VALUES ('126', null, '自信心量表', '我是一个自信的人吗？对哪些事情自信？自信就够了？', 'Upload/2017-01-04/992.jpg', '自信心量表（Rosenberg   Self-Esteem   Scale）是由美国心理学家罗森伯格（M.Rosenberg）制定，它是世界上最常用的测量个人自信心的量表i。共有10个测题，用以测量个人对自我感觉的好坏程度。', '以下是一组有关自信心的句子，请按你的情况作答。', '2', '2', '0', '30', '10', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('1', 'cpq14pf', '卡特尔14pf人格量表(14PF)', '3岁看大，7岁看老。人格决定未来，该测测你未来的样子了！（适用于儿童青少年）', 'Upload/2017-01-04/1.jpg', '1', '适用于8-14岁的中小学生，主要从乐群性、聪慧性、（情绪）稳定性、恃强性、兴奋性、有恒性、敢为性、敏感性、怀疑性、幻想性、世故性、忧虑性、自律性和紧张性这14种人格因素进行测评分析。', '亲爱的同学：你好。这里有不少大家都感兴趣的问题，请你来回答。由于每个人对这些问题都会有自己的看法，回答起来一定是不会相同的，因而对这些问题的回答，并没有对与不对之分，只是表明每个人对这些问题的态度，请你不要有所顾虑，要尽量坦率地表达自己对这些问题的真实兴趣和态度。对测题不要费时间去考虑怎样答才对，因为无所谓对错，而要顺其自然，你是怎样想的和做的就怎样回答。注意：每一测题都要回答，不要有遗漏。每一测题只能选择一个答案，不许多选。必须在50分钟内回答完全部测题，请掌握好时间。', '3', '3', '0', '1', '140', '0', '0', '', null);
INSERT INTO `max_lblist` VALUES ('2', 'scl90', '症状自评量表(SCL-90)', '身体有症状会容易发现，心理有症状了怎么发现？多视角发现你的心理症状！', 'Upload/2017-01-04/19.jpg', '5', '症状自评量表由L.R.Derogatis于1975年编制,含有90个项目，每项5级评分．测量较广泛的精神症状学内容，从感觉、情感、思维、意识、行为指导生活习惯、人际关系、饮食睡眠等，要求被试者根据自己的实际情况来做评定。测得的是一个人某段时间里（通常是一周）的症状水平。本量表使用简便，测查角度全面。它对有可能处于心理障碍边缘的人有良好的区分功能，适用与测查人群中哪些人可能有心理障碍、有何种心理障碍及其严重程度如何。在临床上常常作为诊断的参考，也可以用作初级的筛查工具。', '亲爱的同学，你好。以下表格中列出了有些人可能有的病痛或问题，请你仔细阅读每一道试题，然后根据最近一星期内的状况，回答下列问题，请在最合适的圆格内单击鼠标左键。为了保证检测结果的准确性，请不过要漏掉其中的任何一题。\r\n\r\n1.从无：自觉无该项症状问题。\r\n2.轻度：自觉有该项问题，但发生得并不频繁、严重。\r\n3.中度：自觉有该项症状，其严重程度为轻到中度。\r\n4.偏重：自觉常有该项症状，其程度为中到严重。\r\n5.严重：自觉常有该项症状，频度和程度都十分严重\r\n', '9', '9', '0', '2', '90', '0', '0', '', '从无|轻度|中度|偏重|严重');
INSERT INTO `max_lblist` VALUES ('3', 'zylx', '性格与职业类型测试', '我最适合什么工作？', 'Upload/2017-01-04/7.jpg', '3', '选择职业是人生中一项非常重要的抉择，它不仅决定了人们今后将从事的道路，而且在很大程度上决定了人们的生活方式和生活内容。本系统是美国著名职业指导专家 Ｊ.霍兰德（ＨＯＬＬＡＮＤ）编制的, 在几十年间经过一百多次大规模的实验研究，形成了人格类型与职业类型的学说和测验。该测验能帮助被试者发现和确定自己的职业兴趣和能力专长, 从而科学地做出求职择业的决定。由中科院心理所方莉洛老师修订。', '选择职业是人生中一项非常重要的抉择，它不仅决定了人们今后将从事的道路，而且在很大程度上决定了人们的生活方式和生活内容。根据问题提示选择适合你的答案，系统将自动进行分析。', '4', '4', '0', '3', '48', '0', '0', null, '是|否|不能确定');
INSERT INTO `max_lblist` VALUES ('4', 'sti', '斯特里劳气质调查表(STI)', '你拥有哪种独特的气质？', 'Upload/2017-01-04/2.jpg', '1', '波兰心理学家简&#8226;斯特里劳（J.Streleu）在巴甫洛夫学说的基础上，从整体活动来探讨气质问题。他认为，气质是生物进化的产物，但不受环境影响而发生变化。气质在人的整个心理活动中，在人与环境关系中起着调节作用。并认为，反应性和活动性是两个与行为能量水平有关的气质基本维度，它们对有机体起着重要的调节作用。高反应性的人感受性高，耐受性低；低反应性的人感受性低，耐受性高。他所编制的《斯特里劳气质调查表(STI)》是用来评定神经系统的四个特性，即兴奋强度、抑郁强度、神经过程平衡性、神经过程灵活性，是目前国际上最具有影响力的气质量表之一．', '斯特里劳气质调查问卷共有134个测试题目，请按顺序回答。全卷答完前，请不要回头查看，因为气质并无好坏之分，所以回答要诚实。量表分为“是”、“否”、“不能确定”三个等级，请按照自己的实际情况作答。', '3', '3', '0', '4', '134', '0', '0', null, '是|否|不能确定');
INSERT INTO `max_lblist` VALUES ('5', 'mht', '心理健康诊断测验(MHT)', '来给心理健康做个测量吧！', 'Upload/2017-01-04/13.jpg', '4', '学生心理健康综合测量包含学习焦虑、对人焦虑、孤独倾　向、自责倾向、过敏倾向、身体症状、恐怖倾向、冲动倾向八个方面，100个测验题目。可以帮助学生更深入地了解自己，帮助自己保持良好心态。\r\n', 'A、这些测题是调查你的心情和感受的，不是测验智力和学习能力，与学习成绩无关，答案也没有好坏之分，请按照你平时所想的如实回答。\r\nB、难以决定时，请选择与你最接近的答案。', '5', '5', '0', '5', '101', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('6', 'cpq16pf', '卡特尔16种人格因素问卷(16PF)', '世界上没有两片完全相同的叶子，也没有完全一样的人格，快来测测你的人格因素吧！', 'Upload/2017-01-04/49.jpg', '1', '该问卷由美国著名心理学教授卡特尔(R.B.Cattell)用因素分析法编制而成。施测该问卷可以得到16种主要的人格特质因素，分别是：乐群性、聪慧性、（情绪）稳定性、恃强性、兴奋性、有恒性、敢为性、敏感性、怀疑性、幻想性、世故性、忧虑性、实验性、独立性、自律性和紧张性。', '本测验共有187道题目， 都是有关个人的兴趣和态度等问题。每个人对这些问题是会有不同看法的，回答也是不同的，因而对问题如何回答，并没有“对”与“不对”之分，只是表明你对这些问题的态度。请你要尽量表达个人的意见，不要有顾虑。\r\n本测验每一测题有三个可选答案。答题时应注意的是：\r\n1.每一测题只能选择一个答案；\r\n2.不可漏掉任何测题；\r\n3.尽量不选择“B”答案；\r\n4.本测验不计时间，但应凭自己的直觉反应进行作答，不要迟疑不决，拖延时间。一定要在一个小时以内完成整个测验。\r\n5.有些题目你可能从未思考过，或者感到不太容易回答。对于这样的题目，同样要求你做出一种倾向性的选择。\r\n', '3', '3', '0', '6', '187', '0', '0', '', null);
INSERT INTO `max_lblist` VALUES ('7', 'sds', '自评抑郁量表(SDS)', '我想哭却哭不出来。我抑郁了吗？', 'Upload/2017-01-04/29.jpg', '5', '自评抑郁量表是W.K.Zung于1965年编制，用于衡量抑郁状态的轻重程度及其在治疗中的变化。该量表的评定时间跨度为最近一周，评分不受年龄、性别、经济状况等因素影响，但如受试者文化程度较低或智力水平较差不能进行自评。', '该量表由20个陈述句和相应问题条目组成；每一条目相当于一个有关症状，均按1、2、3、4四级评分，请根据自己的实际感受选择相关回答。', '6', '6', '0', '7', '20', '0', '0', null, '偶尔或从无|有时|经常|持续');
INSERT INTO `max_lblist` VALUES ('8', 'xxjl', '学习焦虑倾向测量', '一学习就焦虑，咋办？', 'Upload/2017-01-04/14.jpg', '4', '青少年正处在学习知识、增长能力的重要时期。近年来，随着升学考试和就业难度的增加，他们面临的学习压力普遍加大，当压力超过了他们所能承受的程度时常常会引发对学习和考试的焦虑、紧张、不安、抑郁、恐惧等情绪困扰，影响了正常的学习和生活的进行，这就是学习焦虑的表现。正确诊断青少年学生的学习焦虑问题，不仅有利于对青少年进行心理咨询，而且对教师和家长正确地了解和指导青少年具有重要的价值。', '这个测验是调查你的心情和感受的，不是测验智力和学习能力，与学习能力无关，答案也无好坏之分，请按照你平时所想的如实回答。\r\n本测验每一问题都只有“A.是”和“B.不是”两种可供选择的答案，按你平时所想的如实回答。每一问题都要回答，但只能选一个答案。难以决定时请选与你接近的答案。', '5', '5', '0', '8', '15', '0', '0', '', '是|不是');
INSERT INTO `max_lblist` VALUES ('9', 'embu', '父母养育方式问卷(EMBU)', '你的父母是怎么培养你的？到你评价的他们的时候了！', 'Upload/2017-01-04/23.jpg', '6', '父母教养方式问卷于1980年由瑞典Umea大学精神医学系C.Perris等人编制，用于评定父母的教养方式。中文版EMBU由中国医科大学心理学教研室的岳冬梅、李鸣果、金魁和、丁宝坤修订。修订后的量表经过主因素分析，确定了66个条目。\r\n　　量表要求被试回忆早期经历的父母教养方式，并作出4级评分。施测时间约30分钟。\r\n　　该量表不适用于年龄幼小的被试和年龄过大的被试，而适用于中青年被试（15～54 岁左右），该年龄段的被试对父母的评价更客观、稳定，回忆的准确性也较高。\r\n', '在每个人成长的过程中，父母的言传身教都给我们留下了深刻的印象。请您努力回想一下在您小时候父母对待您的方式，回答问题。\r\n每个题目均有4个等级，分别是“从不、偶尔、经常、总是”。请您分别选择最适合您父亲和您母亲的等级，先对父亲做评定，再对母亲做评定。您父亲和母亲对您的教养方式可能是相同的，也可能是不同的。请您实事求是的分别回答。\r\n4个等级之后还有一个选项是“题目不适”。如果您幼时父母不全，或者您是独生子女，应对相关的题目作出“题目不适”的回答。', '10', '10', '0', '9', '66', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('12', 'fes', '家庭环境量表(FES)', '家庭深刻地影响着一个人的发展，你的家庭是什么样子的？', 'Upload/2017-01-04/24.jpg', '6', '该量表含有10个分量表，分别评价10个不同的家庭环境特征：（1）亲密度（Cohesion），即家庭成员之间互相承诺、帮助和支持的程度；（2）情感表达（Expressiveness），即鼓励家庭成员公开活动，直接表达情感的程度；（3）矛盾性（Conflict），也就是家庭成员之间公开表露愤怒、攻击和矛盾的程度；（4）独立性（Independence），即家庭成员的自尊、自信和自主程度；（5）成功性（Achievement Orientation），是将一般性活动，如上学和工作变为成就性或竞争性活动的程度；（6）知识性（Intellectual-Cultural Orientation），即对政治、社会、智力和文化活动的兴趣大小；（7）娱乐性（Active-Recreational Orientation），即参与社交和娱乐活动的程度；（8）道德宗教观（Moral-Religious Emphasis），即对伦理、宗教和价值观的重视程度；（9）组织性（Organization），即安排家庭活动和责任时有明确的组织和结构的程度；（10）控制性（Control），即使用固定家规和程序来安排家庭生活的程度。\r\n该问卷的中文版（简称FES-CV）由费立鹏等人于1991年修订。中文版对一些不适合中国文化的条目做了修改，并改写了两个最不符合中国文化的分量表：独立性和道德宗教观。\r\n修订结果显示，该量表效度较好。精神分裂症病人及其家属的评定没有显著差异，说明病人及家属对家庭环境的感受基本一致。正常人家庭和精神分裂症病人家庭4个分量表上有显著差异，正常人家庭在亲密度、知识性和娱乐性分量表中得分显著高于精神分裂症病人家庭，在矛盾性分量表上得分显著低于精神分裂症家庭，说明量表具有较好的判别效度。家庭亲密度和适应性量表中文版（FACESII-CV）评定的亲密度与本量表评定的亲密度呈正相关，与本量表评定的矛盾性呈负相关，说明有较好的趋集效度。\r\n量表的重测信度在不同的分量表中有所不同。亲密度、矛盾性、知识性和组织性4个分量表的内部一致性信度较高，成功性、娱乐性和控制性3个分量表的一致性稍差，独立性、道德宗教观和情感表达3个分量表的内部一致性信度很差。可能是因为这些分量表的内容不太适合中国文化。在应用量表做解释时应该慎重。使用量表对学习成绩良好和成绩差的儿童测查发现，高分儿童的家庭气氛更融洽，家庭成员自由表达情感的程度更高，追求成功的动机较强，同时高分儿童家庭冲突较少，彼此攻击和敌视的现象较少。这样的家庭特征有利于培养儿童的学习积极性，提高学习效率。\r\n量表使用要求受试者具有初等以上教育程度，主试应监控受试者完成量表的全过程，在受试者不能理解多个项目时应中止测试并确认答卷无效。', '该问卷用于了解您对您家庭的看法。请您确定以下问题是否符合您家里的实际情况。如果您认为某一问题符合或基本上符合您家庭的实际情况，请选择“是”；如果不符合或基本上不符合，请选择“否”。如果难以判断是否符合，您应该按多数家庭成员的表现或者经常出现的情况做答。如果仍无法确定，就按您自己的估计回答。请务必回答每一个问题。有些问题带有“★”，表示此句有否定的含义，请注意正确理解句子内容。记住，该问卷所指的“家庭”是指与您共同食宿的小家庭。在回答问卷时不要推测别人对您的家庭的看法，请一定按实际情况来回答。', '10', '10', '0', '10', '90', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('14', 'conners', 'Conners儿童行为量表（父母问卷）', '父母如何通过孩子的行为判断他的心理健康程度？', 'Upload/2017-01-04/21.jpg', '9', '同Achenbach（CBCL）儿童行为量表、Butter儿童行为量表一样， Conners儿童行为量表也是一种应用十分广泛、有较高信度和效度的儿童行为测量方法。目前使用较多的是父母问卷和教师问卷，与其它方法相比，该量表具有条目少、简便易行等特殊优点。这里介绍的是父母问卷，即由父母根据自己孩子的实际情况，实事求是地回答每个问题。该量表共有48个项目。', '请根据您的孩子最近1年的情况，选择最符合他（她）实际的那个选项，请如实回答每个提问。', '9', '9', '0', '14', '48', '0', '0', null, '没有|很轻|较重|严重');
INSERT INTO `max_lblist` VALUES ('16', 'aat3', '学习适应性测验(AAT)', '学习不适应？改变方法！', 'Upload/2017-01-04/15.jpg', '4', '学习适应性指克服种种困难取得较好学习效果的一种倾向,也可以说是一种学习适应能力，它的主要因素有学习热情、学习计划性、学习方法、学习环境以及性格和身心健康等。\r\n   如何对造成中小学学生学习不良的非智力因素和环境因素作出正确的诊断，并给予适当的指导，这是当前中小学心理辅导和学习辅导工作中迫切学要解决的问题。由周步成教授领导的课题组对日本教育研究所学习适应性测验研究部所编的《学习适应性测验》进行了修订，并制订出中国的常模。本测验不仅是中小学生学习不良的理论研究、诊断及实际指导工作必不可少的工具，而且也为教师和家长指导学生及孩子的学习提供极为丰富的资料。\r\n   本量表适用范围为初中一年级至高中三年级。', '这个调查不是要了解你是好孩子还是坏孩子，而是详细地调查你是怎样学习的，目的是为了使你的学习比现在好，需要作哪些改进。请根据你的实际情况做出选择即可。\r\n1.按你平时想的和做的，如实地回答。\r\n2.每一个问题都要回答，但只能选择一个答案，如果认为没有合适的答案，可以选出与自己接近的答案。\r\n3.不要与同学商量，不要照抄同学的答案。\r\n4.不明白题目意思或者不认识的字，可举手问老师。\r\n5.回答时没有限制，但不要过分考虑，请选择你最初想到的答案。', '5', '5', '0', '16', '151', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('19', 'conners2', 'Conners儿童行为问卷（教师用卷）', '教师如何通过学生的行为判断他的心理健康程度？', 'Upload/2017-01-04/22.jpg', '9', 'Conners氏量表应用至今约有20年历史，是筛选儿童行为问卷（特别是多动症）用得最广泛的量表。教师问卷用得最为广泛，有表有39条目（1969，1973年），1978年修订为28个条目，较原版更扼要实用。采用四级记分法（0、1、2、3）。这28条可归纳为四个因子，包括儿童在学校中常见的我恩体。此问卷的信度、效度亦基本通过检验。', '请按照实际情况选择不同项目的程度情况，所有项目请全部填写。', '9', '9', '0', '19', '28', '0', '0', null, '无|稍有|相当多|很多');
INSERT INTO `max_lblist` VALUES ('20', 'phcss', '儿童自我意识量表', '镜中你的样子与你心中的样子一致吗？你是如何看待你自己的？', 'Upload/2017-01-04/27.jpg', '2', '儿童自我意识量表(Children\'s self-concept Scale，PHCSS) 是美国心理学家Piers 及Harris 于1969年编制、1974年修订的儿童自评量表，主要用于评价儿童自我意识的状况。儿童自我意识反映了儿童对自己在环境和社会中所处的地位的认识, 也反映了评价自身的价值观念,是个体实现社会化目标、完善人格特征的重要保证。如果在发育过程中受内外因素的影响,使儿童的自我意识出现不良倾向,则会对儿童的行为、学习和社会能力造成不良影响, 使儿童的人格发生偏异。\r\nPHCSS含80项是否选择型测题,适用于8-16岁儿童。', '下面有80个问题,是了解你是怎样看待你自己的。请你决定哪些问题符合你的实际情况,  哪些问题不符合你的实际情况。 如果你认为某一个问题符合或基本符合你的实际情况,就在答卷纸上相应的题号后的\"是\"字上划圈,如果不符合或基本不符合你的实际情况,就在答卷纸上相应的题号后的\"否\"字上划圈。 对于每一个问题你只能作一种回答,并且每个问题都应该回答。请注意,这里要回答的是你实际上认为你怎样,而不是回答你认为你应该怎样。', '12', '12', '0', '20', '80', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('22', 'zyqx', '职业倾向系列问卷', '将自己的兴趣特长发展成事业是每个人的愿望，快来测测最合适你的职业吧！', 'Upload/2017-01-04/50.jpg', '3', '一般来说，人们在择业时主要受三个因素的影响：兴趣（你想做什么）、能力（你能做什么）和人格（你适合做什么）。以此为依据，这套系列问卷由三部分组成：兴趣倾向问卷、个体经历问卷和人格倾向问卷，分别对你的兴趣、能力和人格特点进行测查，帮助你更加全面的了解自己，以便在升学和择业时能够有的放矢。', '职业倾向系列测验由兴趣倾向问卷、个体经历问卷和人格倾向测验三个测验组成，请仔细阅读每一道题目，并根据自己的实际情况回答“是”或“不是”，所有题目的答案无对错之分。答题时注意，请根据自己的第一反应回答。不要过分推敲，以保证结果的真实可靠。做完所有题目后通过对结果进行分析，你将会比较全面、准确的了解自己的职业兴趣，从而为将来的职业选择和报考专业提供参考。', '4', '4', '0', '22', '144', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('24', 'zydx', '兴趣与职业定向自我测试', '毕业等于失业？还是我不太懂我自己的职业方向？', 'Upload/2017-01-04/8.jpg', '3', '下面这个量表有助于青年人的职业定向，根据这张表，每个中学生在学习期间，就可以查明并巩固自己的兴趣，避免毕业选择志愿和专业的手足无措。', '请你根据自己的实际情况，对下面的135道题作出回答。', '4', '4', '0', '24', '135', '0', '0', null, '非常喜欢|比较喜欢|不确定|比较不喜欢|非常不喜欢');
INSERT INTO `max_lblist` VALUES ('27', 'ssgx', '师生关系测验问卷', '你与老师的关系怎么样？你的小动作出卖了你。', 'Upload/2017-01-04/35.jpg', '7', '中学生对自己同老师之间的关系是极为敏感的。他们可能因与老师的关系处理得好而觉得学习、生活愉快，也可能因与老师关系处理得不好而感到前途无望。了解自己与老师关系的问题的所在，是改进师生关系的前提。这里介绍一个师生关系测验问卷，以帮助中学生了解自己的师生关系状况。', '本测验共有18个陈述句项目。请仔细阅读每个项目，并对照自己的实际情况，作为“是”与“否”的判断。然后从每个项目后的“是”与“否”备选答案中选择其中的一个，点击鼠标。', '8', '8', '0', '27', '18', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('30', 'tat', '考试焦虑自评量表(TAT)', '我考试焦虑了吗？', 'Upload/2017-01-04/16.jpg', '4', '考试焦虑直接影响到考试水平的发挥和成绩的提高，本量表帮助您判断自己的考试焦虑程度并为您提供一些意见和建议。', '考试焦虑直接影响到考试水平的发挥和成绩的提高，本量表帮助您判断自己的考试焦虑程度并为您提供一些意见和建议。请根据您的实际情况选择回答。', '5', '5', '0', '30', '33', '0', '0', null, '非常符合|比较符合|较不符合|很不符合');
INSERT INTO `max_lblist` VALUES ('44', 'spm', '瑞文推理测验标准型(SPM)', '我的智商够用吗？', 'Upload/2017-01-04/33.jpg', '10', '《瑞文智商测试系统》是根据瑞文测验联合型（CRT）编制而成。瑞文测验是英国心理学家瑞文（J.C.Raven）于1938年创制，在世界各国得到广泛的应用。它是一种非文字的智力测验，是“测验 一个人的观察力及清晰思维的能力”，适用范围为5--75岁。\r\n   一般人完成瑞文测验，大约需用半小时左右，测验结果可以计算出原始分数然后根据常模资料（即将一个被试的分数与其所属团体作比较）确定被试的智力等级，或者换算成被试的智商值。 \r\n    心理学家的大量研究表明，瑞文测验测量了智力的许多因素，包含多种可认为是ｇ因素的方面，推理能力常常被称为智力的核心成分。可以说，瑞文测验所测到的因素与其它智力测验相比，更且有一般性。\r\n    瑞文测验的实用价值突出表现于它的适用范围之广。不同年龄、从事不同职业、说不同语言、有不同文化背景的人都可以用，可以用它作工具，进行跨文化的研究、多年龄组的研究、正常儿童和聋哑儿童的比较研究等；医学上也可以用它作为诊断和研究的辅助工具。此外，瑞文测验使用方便，经济实用 , 且测验结果也比较可靠。', '这是一个关于图形的测验。在每组图中，你将看到一个大长方形和几个小块图案。大长方形里的图案的形状和排列是有规律的，但右下方缺少一个图案。在它下面有多个小块图案，其中之一是从长方形中取出来的。请你判断哪个小图案是长方形的一部分。', '7', '7', '0', '44', '60', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('45', 'lsia', '生活满意度指数A(LSIA)', '生活是一个三棱镜，你喜欢反射出的哪个颜色？', 'Upload/2017-01-04/36.jpg', '8', '生活满意度量表（Life  Satisfaction  Scales）包括三个独立的分量表，其一是他评量表，即生活满意度评定量表（Life  Satisfaction  Rating  Soale），简称LSR；另外两个分量表示自评量表，分别为生活满意度指数A（Life  Satisfaction  Index  A）和生活满意度指数B（Life  Satisfaction  Index  B），简称LSIA和LSIB。', '下面的一些陈述涉及人们对生活的不同感受。请阅读下列陈述，如果你同意该观点，就请在“同意”下做记号，如果你不同意该观点，请在“不同意”下做记号，请务必回答每一个问题。', '13', '13', '0', '45', '20', '0', '0', null, '同意|不同意');
INSERT INTO `max_lblist` VALUES ('47', 'epq1', '艾森克人格问卷少年式(EPQ)', '我内向？我外向？我平时能保持情绪稳定吗？', 'Upload/2017-01-04/3.jpg', '1', '艾森克人格问卷（EPQ）是由英国心理学教授艾森克及其夫人编制，从几个个性调查发展而来。相对于其它以因素分析法编制的人格问卷而言，它所涉及的概念较少，施测方便，有较好的信度和效度，是国际上最具影响力的心理量表之一。\r\n　　EPQ由P、E、N、L四个量表组成，主要调查内外向（E）、神经质（N）、精神质（P）三个维度。艾森克认为个性可分析出三个维度，其中E维因素与中枢神经系统的兴奋、抑制的强度密切相关，N维因素与植物性神经的不稳定性有密切相关。艾森克认为遗传因素对三个维度均有影响。正常人也具有神经质和精神质，这两者又可以通俗地说成是情绪稳定性和倔强性，而不是暗指神经症和精神病。但是高级神经的活动如果在不利因素影响下也可能向病理方面发展。L量表是测验受试者的“掩饰”倾向，同时也有测量受试者的社会幼稚水平的作用。\r\n　　EPQ的少年式，适用于7－15岁的少年儿童。', '下面将要给你呈现一系列问题，请你回答自己的情况“是”（选①）或“不是”（选②）这样。这里没有对你不利的题目，答案也无所谓正确与错误。\r\n　　请尽快回答，不要在每道题目上想很长时间。回答时不要考虑应该怎样，只回答你平时是怎样的。每题都要回答。\r\n', '3', '3', '0', '47', '74', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('49', 'xxsy', '儿童学习适应性调查表', '我是一名小学生，我适应学习了吗？', 'Upload/2017-01-04/17.jpg', '4', '心理适应量表主要是根据儿童的生理变化、活动状况以及一些自我体验来判断其在现有的学习、生活环境中是否能够适应良好。', '下面列举了一些你在日常生活中的一些反应，请根据实际情况回答。', '5', '5', '0', '49', '80', '0', '0', null, '没有|偶尔|经常');
INSERT INTO `max_lblist` VALUES ('50', 'cw70', '智力测验(CW70)', '我的智商够用吗？', 'Upload/2017-01-04/34.jpg', '10', '智力是一个相对概念，根据学生的测验得分和常模进行对照，以判断您在一些计算、常识和逻辑运算等方面是否存在一定的不足或缺陷。当然，测量结果仅供参考。', '1、你必须在50分钟内完成全部70个题目，一定不要超过时间。 \r\n2 .不要在一个题目上耽搁太久，如果回答不出，就猜一个答案，不要留下未回答的题目。 \r\n3. 如果一个题目看起来有一个以上的正确答案或没有正确答案，选一个你认为最好的答案。这些题目是为了测验你的思考力而有意设计的。', '7', '7', '0', '50', '70', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('52', 'swnl', '思维能力测试', '你是乐天派还是悲观派？你的思维圈住了你！', 'Upload/2017-01-04/9.jpg', '3', '本测量主要从您的类比、推理、发散思维等方面进行测量和判断，看看您的思维能力属于一个什么样的层次和水平。该量表比较简单，测量结果仅供参考。', '思维能力是一个人智力的核心组成部份，请根据提示选择您认为合适的答案或者填写合理的回答。', '4', '4', '0', '52', '10', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('53', 'cznl', '创造能力自测', '创新是一种能力。我具备这种能力吗？', 'Upload/2017-01-04/10.jpg', '3', '创造能力是一个人事业成功的基础，也是智能的核心组成部份。本量表主要是根据学生的自我行为评判来了解其创造能力。', '创造能力是一个人事业成功的基础，也是智能的核心组成部份。请根据您自己的实际感受、体验或观点选择适合您自己的回答，以判断您自身的创造能力如何。', '4', '4', '0', '53', '20', '0', '0', null, '是的|不是');
INSERT INTO `max_lblist` VALUES ('54', 'zxx', '自信心测试', '很多困难其实并不存在，很多顾虑其实只在自己心中。你有多自信就离成功有多近！', 'Upload/2017-01-04/52.jpg', '2', '该量表主要是针对被试在日常生活中的一些自我体验和观点进行测试以判断其自信程度。主要适合大学生以及成人。', '这是一个测量自己自信心的量表，请根据您的实际感受选择合适的回答。', '0', '12', '0', '54', '40', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('57', 'yzl', '意志力测试', '我的意志够坚定，够持久吗？', 'Upload/2017-01-04/11.jpg', '3', '本测试主要根据被试在日常生活中反映出的行为习惯来判断其意志是否坚定和持久。', '根据每句话的描述是否符合你的实际情况来选择,有5级评定,分别是完全同意\\比较同意\\介于同意与不同意之间\\比较不同意\\完全不同意。请选择最符合您的情况。', '4', '4', '0', '57', '26', '0', '0', null, '完全符合|比较符合|难以回答|比较不符|完全不符');
INSERT INTO `max_lblist` VALUES ('59', 'mmpi2', '明尼苏达多相个性调查表(MMPI)', '想骗自己都办不到。（适用于16岁以上人群）', 'Upload/2017-01-04/6.jpg', '1', '明尼苏达多相人格测定（MMPI）是由美国明尼苏达大学的心理学家哈撒韦和精神科医生麦金利于1940年编制而成，主要用途为判别正常人和精神疾病患者。MMPI于80年代被引进中国，中国科学院心理研究所组织了标准化修订工作，经过几十年的发展和修正完善，MMPI在中国得到了广泛运用。该测验适用于年满16岁、初中以上文化水平及没有什么影响测验结果的生理缺陷的人群，分为566项、399项等几种类别，其中在中国最常用的是566项，也就是本软件采用的这种。该量表在心理咨询中心、心身医学门诊、精神病院、人才市场、职业介绍所、大中学校等部门都有广泛的运用，对人才心理素质、个人心理健康水平、心理障碍程度都能有较高的使用价值。MMPI为心理咨询工作者和精神医学工作者必用的心理测验之一。', '明尼苏达多相个性测验表说明\r\nＡ、本测验由许多与你有关的问题组成，当你阅读每一题目时，请考虑是否符合你的行为，感情、态度及意见。\r\n如果情况符合，请选择相对应答案。\r\n如果情况不符合，请选择相对应答案。\r\n如果确实不能判定，请选择相对应答案。\r\nＢ、应尽可能对每个问题给予回答，不要空下题目不答。\r\nＣ、请尽快填写你看完题目后的第一个印象，不要在每一道题目上费太多时间思索。\r\n　　个性各有不同，答案无所谓对与不对，好与不好，完全不必有任何顾虑。\r\nＤ、务请看清题号然后在答案后做选择，以免发生错误。', '0', '3', '0', '59', '566', '0', '0', null, '是|否|无法回答');
INSERT INTO `max_lblist` VALUES ('61', 'aslec', '青少年生活事件量表(ASLEC)', '这些事对你的影响有多深？', 'Upload/2017-01-04/25.jpg', '6', '对我国较常见的生活事件（引起人们精神刺激的事件）进行定性定量，测查在某时间段内所受的精神负荷，以甄别高危人群，预防心理障碍和心身疾病。本量表适用于青少年。目前多应用于综合性医院各科门诊以确定心理因素对疾病发生，发展和转归中的作用份量，也用于指导心理治疗，危机干预，以及指导正常人了解自己的精神负荷。', '你的生活是平静如水还是波涛澎湃的？过去一年，你和你的家庭是否发生过类似事件？请根据实际情况选择相应回答。', '11', '11', '0', '61', '27', '0', '0', null, '从未发生过|发生过并对您的影响：没有|轻度|中度|重度|极重');
INSERT INTO `max_lblist` VALUES ('62', 'ias', '交往焦虑量表(IAS)', '特别想却不敢跟TA说话？不想纠结就来看看你有社交焦虑吗？', 'Upload/2017-01-04/30.jpg', '5', '该量表主要是根据被试在人际交往过程中的一些反应情况来判断其焦虑程度，用以以判别和改善被试的人际交往状况。', '下面列举了一些您在日常学习、生活中经常会遇到的场景，请根据您在这些场景的实际反应程度选择合适的回答。', '6', '6', '0', '62', '15', '0', '0', null, '完全不相符|有一点儿相符|中等程度相符|非常相符|极其相符');
INSERT INTO `max_lblist` VALUES ('65', 'willians', '威廉斯创造力倾向测验', '好奇心害死猫！想知道自己的好奇心有多重吗？', 'Upload/2017-01-04/12.jpg', '3', '这是美国著名的创造力教学研究专家威廉斯设计的，被公认为是一个“信度高、效度好”的测量创造性的工具，主要测试好奇心、想象力、挑战性和冒险性四项个性特质水平。', '这是一份帮助你了解自己创造力的练习。在下列句子中，如果你发现某些句子所描述的情形很适合你，则选择“完全符合”；若有些句子只是在部分时候适合你，则选择“部分适合”；如果有些句子对你来说，根本是不可能的，则选择“完全不符”。\r\n注意：\r\n1.每一题都要做，不要花太多时间去想。\r\n2.所有题目都没有“正确答案”，凭你读完每一句的第一印象作答。\r\n3.虽然没有时间限制，但尽可能地争取以较快的速度完成，愈快愈好。\r\n4.切记：凭你自己的真实感受作答。', '4', '4', '0', '65', '50', '0', '0', '', '完全符合|部分符合|完全不符');
INSERT INTO `max_lblist` VALUES ('69', 'gwb', '总体幸福感量表(GWB)', '你的“幸福”跟你自己喝水一样，或冷或暖只有你自己知道。', 'Upload/2017-01-04/38.jpg', '8', '总体幸福感量表[General Well一Being Schedule(Fazio，1977)]是为美国国立卫生统计中心制订的一种定式型测查工具，用来评价受试对幸福的陈述。本量表通过评价个体对幸福的陈述来确定其总体幸福感。本量表覆盖面较广，除了对幸福感的评价，还包括6个方面的内容：对健康的担心、精力、对生活的满意和兴趣、抑郁或愉快的心境、对情感和行为的控制以及松弛与紧张。', '以下问卷涉及到您近期对生活的感受与看法，无好坏之分，根据自己的现实情况和切身体验回答，并请您仔细阅读每道题目，在相应的答案代码上做选择。', '13', '13', '0', '69', '18', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('70', 'tabp', 'A型行为类型问卷(TABP)', '我行为会让我得病吗？', 'Upload/2017-01-04/4.jpg', '1', 'A型行为类型问卷(Type A Behavior  Pattern Scale),简称TABP,是由张伯源教授于1983年主持全国性的协作组开始修订,含有60个题目,用于鉴别行为类型是A型的人。研究参考了美国的一些A型行为测查量表的内容并根据中国人的自身特点，经过三次测试和修订，完成的信度效度教高的A类行为类型量表。', '请根据实际情况，选择“是”、“否。”', '3', '3', '0', '70', '60', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('72', 'xxxgysjn', '学习习惯与应试技能测查表', '面临应试考试，我有优秀的学习习惯吗？', 'Upload/2017-01-04/18.jpg', '4', '这套问卷用于小学高年级学生对其学习习惯和应试技能的自我检查，可帮助学生了解自己在学习习惯和应试技能方面存在的问题。', '请你仔细阅读问卷上的每一个题目，并与自己的实际的情况相对照。若觉得相符，则选择“是”，不相符合则选择“否”。', '5', '5', '0', '72', '44', '0', '0', null, '是|否');
INSERT INTO `max_lblist` VALUES ('73', 'bdi', '贝克抑郁量表(BDI)', '我的世界怎么变成了灰色的？我抑郁了吗？', 'Upload/2017-01-04/31.jpg', '5', 'BDI用于评价抑郁的严重程度。内容源自临床，每个条目代表一个“症状－态度类别”，包括抑郁、悲观、失败感、不满、自罪感、自我失望感、消极倾向、社交退缩、犹豫不决、体象歪曲、工作困难、疲劳、食欲下降等21项内容。对每个条目的描述分为四级，按其所显示的症状严重程度排列，从无到极重，级别赋值为0－3分。总分范围为0－63分。\r\n    施测时应注意，受测者当时的心理状态对该测验很关键。如果让受测者按当天的情况回答，回答的稳定性不能保证；如果让受测者按过去一周的情况回答，稳定性可能好得多。另外，对BDI条目的回答还可能会受社会期望的影响。\r\n    该量表适用于成年的各年龄段，但在用于老年人时会有些困难，因为BDI涉及许多躯体症状，而这些症状对老年人可以是与抑郁无关的其它病态甚或衰老的表现。\r\n    BDI作为最常用的抑郁自评量表，是用于抑郁状态筛查的经典工具。\r\n', '这份问卷有21组陈述。仔细阅读每一组陈述，然后根据您近一周（包括今天）的感觉，从每一组选一条最适合您情况的项目，用鼠标点击。请先把每组陈述全部看完，再选择最适合您情况的那个项目。', '6', '6', '0', '73', '21', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('74', 'epps', '爱德华个人偏好量表(EPPS)', '我不知道我的内心到底想要什么。', 'Upload/2017-01-04/5.jpg', '1', '爱德华个人偏好量表（Edward  Personal  Preference  Schedule, EPPS）是美国心理学家爱德华（A.L.Edwards）以莫瑞（H.A.MURRY）的十五种人类需要理论为基础编制的。爱德华个人偏好量表是由这十五种需要量表和一个稳定性量表所组成，整个测验共有225对叙述组成的题目，其中有15个题目重复两次。EPPS适用于高中生、大学生及一般有阅读能力的成人。测验时间约需要40～50分钟，可以团体施测。', '本测验包括许多成对的语句，任何选择都无所谓对错，对它们所描述的特征，你可能喜欢，也可能不喜欢，其方式你可能曾感觉到，也可能没有感觉到，请你从中选出最能表现或接近你当前特征或感觉的那一个，并将你的选择用“√”标记于答卷纸相应的位置处。如果两句话都没有正确描述你的情况，那你应当选择你认为能比较正确反映你的情况的那一个。\r\n总之，对于每道题的A、B两种选择你必须而且只能选择其一。', '3', '3', '0', '74', '225', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('75', 'lsib', '生活满意度量表B(LSIB)', '生活是一个三棱镜，你喜欢反射出的哪个颜色？', 'Upload/2017-01-04/37.jpg', '8', '生活满意度量表（Life  Satisfaction  Scales）包括三个独立的分量表，其一是他评量表，即生活满意度评定量表（Life  Satisfaction  Rating  Soale），简称LSR；另外两个分量表示自评量表，分别为生活满意度指数A（Life  Satisfaction  Index  A）和生活满意度指数B（Life  Satisfaction  Index  B），简称LSIA和LSIB。', '请就以下问题发表你的意见', '13', '13', '0', '75', '12', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('77', 'xlsy', '心理适应性量表', '面对从中学考入大学、赴异地求学的巨大变化，你的心理适应吗？', 'Upload/2017-01-04/26.jpg', '2', '心理适应性主要指各种个性特征互相配合起来，适应周围环境的能力。一个人能否尽快地适应新环境，能否处理好复杂、重大或危急的特殊情况，与他(她)的心理适应性高低有很直接的关系。新生朋友，从中学考入大学，赴异地求学，学习、生活的环境、方式都发生了很大的变化，这就要求当事人做出适当的调整，以适应新环境、新生活的变化。这里介绍一种简易的心理适应性测试量表，你不妨做一做，了解一下自己的心理适应性现状。', '本量表共20道题目，每题有5种答案。请在阅读每题后，从答案中选择最符合你实际情况的那一项，用鼠标点击。', '11', '11', '0', '77', '20', '0', '0', null, '完全同意|有些同意|无所谓同意或不同意|有些不同意|完全不同意');
INSERT INTO `max_lblist` VALUES ('78', 'sccs', '自我和谐量表(SCCS)', '内心的怪兽与天使总是在打架吗？', 'Upload/2017-01-04/28.jpg', '2', '本测验依Rogers自我和谐（Self Consistency and Congruence）——C﹒Rogers人格理论中最重要的概念之一编制而成。测试者可通过被测者对35个项目的自陈报告，检测被测者自我与经验之间存在的差距，并借此推断被测者出现心理障碍的可能原因及可能的发展趋势。测验从三个方面测查被测者的“不和谐”认知：自我与经验的不和谐、自我体验的灵活性和自我观念的刻板性。', '本测验可以帮助你了解你的紧张和困扰，更接近你的深层认知体系，同时也有利于心理咨询或治疗人员更有效地帮助你建立更完善的自我概念体系。\r\n这35道题是一些个人对自己看法的陈述，填答时，请您看清每句话的意思，然后选择一个项（完全不符，不太符合，不能确定，比较符合，完全符合）以代表该句话与您现在对自己的看法相符合的程度，每个人对自己的看法都有其独特性，因此答案是没有对错的，您只要如实回答就行了。', '12', '12', '0', '78', '35', '0', '0', null, '完全不符|不太符合|不能确定|比较符合|完全符合');
INSERT INTO `max_lblist` VALUES ('89', 'sas', '焦虑自评量表(SAS)', '坐立不安，无法安眠，我怎么了？', 'Upload/2017-01-04/32.jpg', '5', '焦虑自评量表(Self-Rating Anxiety Scale, SAS)是W.K.Zung于1971年编制，用于评出有焦虑症状的个体的主观感受，作为衡量焦虑状态的轻重程度及其在治疗中的变化的依据。SAS是一种分析病人主观症状的临床工具，用于评出有焦虑症状的个体的主观感受，作为衡量焦虑状态的轻重程度及其在治疗中的变化的依据。 而焦虑是心理咨询门诊常见的一种情绪障碍，近年来，SAS已作为咨询门诊中了解焦虑症状的一种自评工具。 SAS测量的是最近一周内的症状水平，评分不受年龄、性别、经济状况等因素的影响，但如果应试者文化程度较低或智力水平较差不能进行自评。', '请您仔细阅读每一个陈述，根据您最近的一周的实际感觉作出回答。从“没有或很少时间”到“绝大部分或全部时间”表示不同的程度。', '6', '6', '0', '89', '20', '0', '0', null, '没有或很少时间|少部分时间|相当多时间|绝大部分或全部时间');
INSERT INTO `max_lblist` VALUES ('96', 'epq4', '艾森克情绪稳定性测验', '你自卑、抑郁、焦虑，还是有强迫症、依赖性、疑心病观念、负罪感？', 'Upload/2017-01-04/20.jpg', '5', '艾森克是英国伦敦大学的心理学教授，是当代最著名的心理学家之一，编制过多种心理测验。情绪稳定性测验可以被用于症断是否存在自卑、抑郁、焦虑、强迫症、依赖性、疑心病观念和负罪感。', '下面给出210道题，请你逐一作答。你可以在“是”、“否”和“不好说”三个答案中选择一个，用鼠标左键单击你的选择。请你尽量选择“是”和“否”。不要过多地思考每个题目的细微意义，最好根据自己的第一感受来回答。', '9', '9', '0', '96', '210', '0', '0', null, '是|否|不好说');
INSERT INTO `max_lblist` VALUES ('101', null, '简明精神病量表(BPRS)', '你觉得身边的TA总有怪异的行为吗？也许TA是真的生病了……（他评量表）', 'Upload/2017-01-04/45.jpg', '11', '简明精神病量表(The Brief Psychiatric Rating Scale， BPRS) 由Overall和Gorham于1962年制。它是精神科应用得最广泛的评定量表之一。该量表长度适中，症状项目合理， 既能比较全面地反映患者的精神状况，又比较简便， 容易掌握， 为大多数精神科工作者所接受， 适宜于国际协作应用。国内外多年的临床实践证明其具有良好的可靠性和真实性。       \r\n     BPRS是一个评定精神病性症状严重程度的他评量表， 适用于具有精神病性症状的大多数重性精神病患者， 尤适宜于精神分裂症患者。     \r\n', '量表评定由评定员对病人做量表精神检查后， 分别根据病人的口头表述和观察情况， 依据症状定义和临床经验进行评分。\r\n    评定员须由经过训练的精神科专业人员担任。\r\n      如果未测则记0分， 统计时应剔除。', '2', '2', '0', '101', '18', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('102', null, '固执性测试', '固执是不科学的顽强。你是固执还是顽强？', 'Upload/2017-01-04/44.jpg', '2', '生活中，有些人在人际交往中表现得非常谦逊和温顺，处处迎合别人的意旨；另有一种人在彼此来往中则常常给人以争强好胜、自以为是的感觉。从理论上讲，生活中这两种人各占近25%，其余50%的人则处于两个极端之间。', '你是否很固执呢？请根据自己的实际情况做出选择。', '2', '2', '0', '100', '13', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('107', null, '汉密顿焦虑量表(HAMA)', '总是担心未来将无法过好现在，焦虑让人每分每秒都备受煎熬，你身边的TA会是这样吗？（他评量表）', 'Upload/2017-01-04/46.jpg', '11', '汉密顿焦虑量表包括14个项目，由Hamilton于1959年编制，他是精神科中应用较为广泛的由医生评定的量表之一。\r\n    适应范围：主要用于评定神经症及其他病人的焦虑症状的严重程度。\r\n    应由经过训练的来年感位评定员进行联合检查，采用交谈与观察的方式，检查结束后，两位评定员各独自评分，若需比较治疗前后症状和病情的变化，则于入组时，评定当地或入组前一周的情况，治疗后2-6周，再次评定以资比较。', '请根据病员的口头叙述辅以你的观察，选出最适合病人情况的选项进行评分。', '2', '2', '0', '107', '14', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('108', null, '汉密顿抑郁量表(HAMD)', '抑郁将所有喜悦都蒙上了一层厚厚的灰尘，你身边的TA会是这样吗？（他评量表）', 'Upload/2017-01-04/47.jpg', '11', '汉密顿抑郁量表（Hamilton Depression Scale，HAMD）由Hamilton于1960年编制，是临床上评定抑郁状态时应用得最为普遍的量表。本量表有17项、21项和24项等3种版本，这套是24项版本。\r\n   这是一套他评量表, 测试由经过训练的来年感位评定员进行联合检查，采用交谈与观察的方式，检查结束后，两位评定员各独自评分，若需比较治疗前后症状和病情的变化，则于入组时，评定当地或入组前一周的情况，治疗后2-6周，再次评定以资比较。\r\n', '请根据病员的口头叙述辅以你的观察，选出最适合病人情况的选项进行评分。', '2', '2', '0', '108', '25', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('113', null, '康奈尔医学指数（CMI）(男性)', '身体离不开心灵的支配，身体也会反应出心灵的不适。你的身心健康吗？（适用于14岁以上男性）', 'Upload/2017-01-04/53.jpg', '6', '康奈尔医学指数（Cornell Medical Index CMI）是美国康奈尔大学Wolff HG.B rodman R.等编制的自测式问卷。全问卷共有195个问题，主要的特点是反映症状丰富，症状涉及躯体症状、家族史和既往史、一般健康和习惯、精神症状多个系统。\r\n    CMI主要应用于以下四个方面： 1、在综合医院及精神病院门诊筛查精神障碍的可疑者； 2、正常人群中筛查躯体和心理障碍者； 3、流行病学研究中，作为一般健康状况的评价指标； 4、医学教学和科研中用来采集标准病史。 \r\n    康奈尔医学指数适用于14岁及以上的成人，可用于正常人，也可用于普通医院及精神病院中非重性精神病患者。\r\n\r\n', '为了获得有关您健康方面的详细情况，以利于对您的疾病进行进一步分析，请您按要求回答下面的问题，根据自己的真实情况选择“是”或“否”，这些问题都十分简单，请不要空下问题不填。\r\n\r\n\r\n', '2', '2', '0', '113', '195', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('114', null, '阴性症状量表(SANA)', '你觉得身边的TA对什么事都提不起兴趣，感觉很怪异吗？也许TA是真的生病了……（他评量表）', 'Upload/2017-01-04/48.jpg', '11', '阴性症状量表（Scale for Assessment of Negative Symptoms，SANS）由美国N. Andreason（1982）编制，用于划分阴性 及阳性症状群。阴性症状指的是精神分裂症中一些普遍共有的特征性症状，比如思维障碍、情感淡漠、意志活动减退及运动障碍等等。它有别于那些在不同类型的精神分裂症或是精神分裂症不同阶段中表现出的各不相同的复杂症状。\r\n　　SANS适用于评定病人最近一个月内的行为，用于行为药理学研究时，可评定最近一周内的行为。SANS分5个分量表，分别是：一、情感平淡或迟钝；二、思维贫乏；三、意志缺乏；四、兴趣社交缺乏；五、注意障碍。量表共有24个项目，做6级评分：(0)无，正常或增加；(1)可疑；(2)轻度，程度虽轻但肯定存在；(3)中度；(4)显著；(5)严重。一次评定约需20－30分钟。评定过程是由评定员参考病史资料，根据项目定义和评分标准，与病人通过交谈检查，对其做主观观察评分。\r\nSANS具有良好的信度效度，在国内应用普遍。\r\n【统计指标和结果分析】\r\n    1．量表总分：即24项单项的总和，反映阴性症状的严重程度，范围为0～120。\r\n    2．分量表综合评价总分：即5个分量表的总评项（7，12，16，21和24）得分的总和，同样能反映阴性症状的严重程度。范围为0～25。\r\n    3．分量表综合评价：即上述5个分量表总评项的单项分，用以反映5种具体的阴性症状的严重程度。在治疗学研究中，它们的变化反映靶症状的疗效。\r\n    4．应用量表结果分型：按量表作者的建议，可按SANS和SAPS结果，将精神分裂症进一步分型。凡分量表总评项≥3者，称为“突出症状群”，然后根据有关阳性和阴性“突出症状群”及其组合，分为3型：\r\n（1）阳性症状为主型。有一个或多个突出的阳性症状群，无突出的阴性症状群。\r\n（2）阴性症状为主型。有两个或更多的突出的阴性症状群，无突出的阳性症状群。\r\n（3）混合型：不符合（1）或（2）者。\r\n', '请选择符合病人情况的描述，按如下等级做评定：\r\n0=无\r\n1=可疑\r\n2=轻度\r\n3=中度\r\n4=显著\r\n5=严重', '2', '2', '0', '114', '24', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('115', null, '阳性症状量表(SAPS)', '幻觉？妄想？你觉得身边的TA总有怪异的行为吗？也许TA是真的生病了……（他评量表）', 'Upload/2017-01-04/54.jpg', '11', '阳性症状量表（Scale for Assessment of Positive Symptoms，SAPS）由美国N. Andreason（1982）编制。 精神分裂症的一些症状虽然不一定在所有类型中都出现，但在一定类型或一定阶段中可能是本病的突出症状，例如幻觉、妄想、行为动作障碍和紧张症候群，这些症状称为阳性症状。\r\n　　本量表是阴性症状量表SANS的补充工具，主要用来评定精神分裂症的阳性症状，包括幻觉、妄想、怪异行为和阳性思维形式障碍。SAPS具有良好的信度效度，主要用途有二：一是用以区分精神分裂症的阳性/阴性症状为主的分型类别；二是用以评估阳性症状的严重程度及其变化。\r\n　　SAPS有4个分量表，分别是：一、幻觉； 二、妄想；三、怪异行为；四、阳性思维形式障碍。共有34个项目。评分为6级评分，在每个项目下有具体的评分标准，由经过训练的评定员对病人进行交谈检查。交谈评定时间约为45分钟到1小时。本量表用于评定最近一个月内的情况。如果用于药理学研究，可每周评定一次。\r\n【统计指标和结果分析】\r\n    SAPS的统计指标和结果分析，与SANS相仿。\r\n1．量表总分：即34项单项分的总和。\r\n2．分量表综合评价分：即项目7，20，25和34的评分。\r\n3．综合评价总分：即上述4项的和。\r\n4．应用量表结果分型：按量表作者的建议，可按SANS和SAPS结果，将精神分裂症进一步分型。凡分量表总评项≥3者，称为“突出症状群”，然后根据有关阳性和阴性“突出症状群”及其组合，分为3型：\r\n（1）阳性症状为主型。有一个或多个突出的阳性症状群，无突出的阴性症状群。\r\n（2）阴性症状为主型。有两个或更多的突出的阴性症状群，无突出的阳性症状群。\r\n（3）混合型：不符合（1）或（2）者。\r\n\r\n', '请选择符合病人情况的描述，按如下等级做评定：\r\n0=无\r\n1=可疑\r\n2=轻度\r\n3=中度\r\n4=显著\r\n5=严重', '2', '2', '0', '115', '34', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('116', null, '康奈尔医学指数（CMI）(女性)', '身体离不开心灵的支配，身体也会反应出心灵的不适。你的身心健康吗？（适用于14岁以上女性）', 'Upload/2017-01-04/55.jpg', '6', '康奈尔医学指数（Cornell Medical Index CMI）是美国康奈尔大学Wolff HG.B rodman R.等编制的自测式问卷。全问卷共有195个问题，主要的特点是反映症状丰富，症状涉及躯体症状、家族史和既往史、一般健康和习惯、精神症状多个系统。\r\n    CMI主要应用于以下四个方面： 1、在综合医院及精神病院门诊筛查精神障碍的可疑者； 2、正常人群中筛查躯体和心理障碍者； 3、流行病学研究中，作为一般健康状况的评价指标； 4、医学教学和科研中用来采集标准病史。 \r\n    康奈尔医学指数适用于14岁及以上的成人，可用于正常人，也可用于普通医院及精神病院中非重性精神病患者。\r\n', '为了获得有关您健康方面的详细情况，以利于对您的疾病进行进一步分析，请您按要求回答下面的问题，根据自己的真实情况选择“是”或“否”，这些问题都十分简单，请不要空下问题不填。', '2', '2', '0', '116', '195', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('118', null, '一般自我效能感量表', '我能主导自己的行为吗？我能控制我的行为吗？', 'Upload/2017-01-04/39.jpg', '2', '自我效能感是指个体对自己面对环境中的挑战能否采取适应性的行为的知觉或信念。一个相信自己能处理好各种事情的人，在生活中会更积极、更主动。这种“能做什么”的认知反映了一种个体对环境的控制感。因此自我效能感是以自信的理论看待个体处理生活中各种压力的能力。', '请仔细阅读下面的一些描述，每个描述后有四个选项，请根据真实情况，选择最符合您情况的一项。', '2', '2', '0', '23', '10', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('120', null, '自尊量表(ses)', '你认为自己是有价值的吗？你愿意接纳自己的全部吗？', 'Upload/2017-01-04/56.jpg', '2', '按一般观点自尊是人们赞赏、重视、喜欢自己的程度。而在社会科学中，自尊是一个可以被定量的假定概念，它是人们对自己的价值、长处、重要性总体的情感上的评价。本量表适用于在校学习的儿童青少年。本量表是近年来国外心理学家常用的自尊问卷。', '请根据题目中的陈述，选择你感觉与自身特点的相符合程度，并用鼠标点击相应的选项。 \r\n（非常符合，符合，不符合，很不符合）\r\n\r\n', '2', '2', '0', '120', '10', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('124', null, '个人评价问卷(PEI)', '我为我的自信心评几分？', 'Upload/2017-01-04/40.jpg', '2', '个人评价问卷（Personal   Evaluation  Inventory，PEI）是用来评定自我评价的一个方面 ——自信。一般认为自信是一个人对自己能力或技能的感受，使对自己有效地应付各种环境的能力主观评价。', '以下列出了许多反映了普遍的情感、态度和行为的陈述、请仔细阅读每一个陈述，考虑一下它是否使用于你。尽量诚实、准确的做答，但没有必要每一条都刻意花太多时间。除非特别标明时间界限、否则请考虑一下近两个月内这些条目对你是否适用：“非常同意”，“基本同意”，“基本不同意”，“极不同意”。', '2', '2', '0', '24', '54', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('126', null, '自信心量表', '对很多事情都没有信心完成吗？你的自信或许成为了你成功的阻碍！', 'Upload/2017-01-04/41.jpg', '2', '自信心量表（Rosenberg   Self-Esteem   Scale）是由美国心理学家罗森伯格（M.Rosenberg）制定，它是世界上最常用的测量个人自信心的量表i。共有10个测题，用以测量个人对自我感觉的好坏程度。', '以下是一组有关自信心的句子，请按你的情况作答。', '2', '2', '0', '30', '10', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('129', null, '考试焦虑量表', '人生就是一个接着一个的考验，面对考试你焦虑吗？', 'Upload/2017-01-04/51.jpg', '4', '考试焦虑量表（Spieberger Test  Anxiety  Inventory）是由美国心理学家斯匹尔格（C．D．Spielberger）制定，使世界上最常用的测量个人考试焦虑的量表。共有20个测题，用以测量个人对考试程度的感觉。', '下面一组人们用来形容自己考试时心情的句子。请仔细阅读每一句话，并依你的情况作答。答案无正、误之分。也不必再任何一句话上花台多时间，只要答出你感到形容你平常感觉的答案即可。', '2', '2', '0', '29', '20', '0', '0', null, null);
INSERT INTO `max_lblist` VALUES ('130', null, '自我信念量表', '有挫折才有成长，面对困难，我信任自己吗？', 'Upload/2017-01-04/42.jpg', '2', '自我信念量表（Schwarzer  General  Self-Efficacy  Scale）是由德国心理学家R.Schwarzer制定，它是测量个人自我信念的常用量表之一。共有10个测题，用以测量个人在遇到困难时对自我信念的高低程度。', '以下是一组有关自我信念的句子，请按你的情况作答。', '2', '2', '0', '30', '10', '0', '0', null, null);
